import classNames from "classnames/dedupe";
import { Container as C } from "reactstrap";


export const Container = ({ children, ...props }) => {
	console.log(props)
	return (
		<C className={ classNames(props.className, "d-flex", "flex-column") } { ...props }>
			{ children }
		</C>
	)
}
